import React from "react";
import { Card, Button } from "antd";
import Avatar from "antd/lib/avatar/avatar";
const UserProfile = ({ setLoggedIn }) => {
  <Card
    actions={[
      <div key="twit">
        짹짹
        <br />
      </div>,
      <div key="followings">
        팔로잉
        <br />0
      </div>,
      <div key="followers">
        팔로워
        <br />0
      </div>,
    ]}
  >
    <Card.Meta avatar={<Avatar>EO</Avatar>} title="EO" />
    <Button>로그아웃</Button>
  </Card>;
};

export default UserProfile;
